% Solve for arc BN
function arcBN = solve_arcBN()
  % constants
  deg2rad = @(d) d*pi/180;
  cos10 = cos(deg2rad(10));
  % coordinates of fixed points
  A = [cos(deg2rad(140)), sin(deg2rad(140))];
  % unknowns: t (P on CN), theta_B
  fun = @(x) angle_equations(x, A, cos10, deg2rad);
  % initial guess
  x0 = [0.5, deg2rad(20)];
  opts = optimset('Display','off');
  x = fsolve(fun, x0, opts);
  t = x(1);
  theta_B = x(2);
  arcBN = rad2deg(theta_B);
end

function F = angle_equations(x, A, cos10, deg2rad)
  t = x(1);
  theta_B = x(2);
  % P on CN
  P = [t, 0];
  % B coordinates
  B = [cos(theta_B), sin(theta_B)];
  % vectors for angle CAP
  AC = -A; % C - A
  AP = P - A;
  cos1 = dot(AC, AP)/(norm(AC)*norm(AP));
  % vectors for angle CBP
  BC = -B; % C - B
  BP = P - B;
  cos2 = dot(BC, BP)/(norm(BC)*norm(BP));
  F = [cos1 - cos10; cos2 - cos10];
end

