% Compute shortest angle bisector in isosceles triangle
a = 26; % side BC
b = 14; % side CA
c = 14; % side AB

% Bisector from A
l_a_sq = b*c*(1 - a^2/(b+c)^2);
l_a = sqrt(l_a_sq);

% Bisector from B
l_b_sq = a*c*(1 - b^2/(a+c)^2);
l_b = sqrt(l_b_sq);

% Bisector from C (same as B)
l_c = l_b;

% Find shortest
shortest = min([l_a, l_b, l_c]);

