% Quadratic function: f(x,y,z) = 2x^2 + 2y^2 + 5z^2 - 2xy - 4yz - 4x - 2z + 15

% Symmetric matrix Q for the quadratic part (x'Qx)
Q = [  2  -1   0;
      -1   2  -2;
       0  -2   5 ];

% Linear term vector c (so that f = x'Qx + c'x + d)
c = [-4; 0; -2];

% Constant term
