function max_val = find_max()
  fun = @(u) - (u(1)+u(2)+u(3) ...
    - log(1+5*exp(u(1))) ...
    - log(4*exp(u(1))+3*exp(u(2))) ...
    - log(5*exp(u(2))+6*exp(u(3))) ...
    - log(exp(u(3))+18));
  u0 = [0;0;0]; % initial guess
  options = optimset('Display','off','TolFun',1e-12,'TolX',1e-12);
  [u_opt, fval] = fminsearch(fun,u0,options);
  x_opt = exp(u_opt(1));
  y_opt = exp(u_opt(2));
  z_opt = exp(u_opt(3));
  max_val = exp(-fval); % because fval = -log f
  fprintf('Maximum value: %g\n', max_val);
  fprintf('x = %g, y = %g, z = %g\n', x_opt, y_opt, z_opt);
end

