How many different triangles can be formed using three vertices of a hexagon as vertices of a triangle? [asy]size(75);
draw(dir(0)--dir(30)--dir(110)--dir(175)--dir(250)--dir(300)--cycle);
[/asy]

octave_code:
% Number of vertices
n = 6;

% Coordinates of regular hexagon on unit circle
theta = 2*pi*(0:n-1)/n;
x = cos(theta);
y = sin(theta);

% All combinations of 3 vertices
comb = nchoosek(1:n,3);
total_triangles = size(comb,1);

% Compute side lengths for each triangle
num = size(comb,1);
sides = zeros(num,3);
for i=1:num
    v = comb(i,:);
    % vertices indices
    p1 = [x(v(1)), y(v(1))];
    p2 = [x(v(2)), y(v(2))];
    p3 = [x(v(3)), y(v(3))];
    d12 = norm(p1-p2);
    d23 = norm(p2-p3);
    d31 = norm(p3-p1);
    sides(i,:) = sort([d12,d23,d31]); % sort to compare shapes
end

% Count distinct shapes
[unique_sides,~,~] = unique(round(sides,10),'rows'); % round to avoid floating errors
num_distinct = size(unique_sides,1);

% Display results
fprintf('Total number of triangles: %d\n', total_triangles);
fprintf('Number of distinct triangles (up to congruence): %d\n', num_distinct);

