% Define points
Q = [0,0];
R = [1,0];
P = [1.1,0.5];

% Compute S and T
S = 0.6*P;
T = R + 0.6*(P-R);

% Vectors
v1 = S - T; % ST vector from T to S
v2 = R - T; % TR vector from T to R

% Compute angle
angle_rad = acos(dot(v1,v2)/(norm(v1)*norm(v2)));
angle_deg = rad2deg(angle_rad);

fprintf('Angle STR = %.2f degrees\n', angle_deg);

