% Define grid points
[xg, yg] = meshgrid(0:3, 0:3);
points = [xg(:), yg(:)];  % 16x2

% All combinations of 4 points
comb = nchoosek(1:16, 4);

areas = [];

for k = 1:size(comb,1)
    idx = comb(k,:);
    pts = points(idx,:);
    % pairwise squared distances
    d = [];
    for i = 1:4
        for j = i+1:4
            diff = pts(i,:) - pts(j,:);
            d = [d, diff*diff'];
        end
    end
